import Artist from './Artist'

const Artists = ({ artists }) => {
  return (
    <section>
      <h2>Nos artistes</h2>

      <div className="artists-list">
        {artists.map((artist) => (
          <Artist key={artist.id} artist={artist} />
        ))}
      </div>
    </section>
  )
}

export default Artists
